import React from "react";
import backgroundimage from "./images/kelli-mcclintock-wBgAVAGjzFg-unsplash.jpg";
import "../style.css"

function Dashboard() {
  return (
    <div>
      {/* Background Section */}
      <div
        className="h-screen d-flex justify-content-center align-items-center"
        style={{
          backgroundImage: `url(${backgroundimage})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
        }}
      >
        {/* shadow-lg add this class to THE HOME OF MILITARY MENTAL HEALTH for shadow effect  */}
        <h1 className="text-center  display-6  hometype">
          THE HOME OF MILITARY MENTAL HEALTH
        </h1>
      </div>


      <div className="container py-5 bg-slate-50">
        <div className="row">
          <div className="col-2"></div>


          <div className="col-4">
            <h2 className="mb-3">Our Mission</h2>
            <p className="">
              The Lemich Clinic for Military Mental Health was founded on the
              belief that everyone who serves should have access to high
              quality, confidential, mental health care. The majority of our
              clients are active duty sailors at Naval Station Norfolk. We also
              see service members from the other military installations in
              Virginia. We also work with military spouses and recent veterans.
              If you are a first responder or outside the military, contact us
              to see if you qualify for our program.
            </p>
          </div>

          {/* Third Column (4 Columns Wide) */}
          <div className="col-4"></div>

          {/* Fourth Column (2 Columns Wide) */}
          <div className="col-2"></div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
